class TitlePart2 extends Component {
  render () {
    return (
      <div className='title__part__2'>
        <p>WHY ?</p>
        <p><span className='yellow__span'>THIS IS THEIR STORIES</span></p>
      </div>
    )
  }
}

export default TitlePart2
